    "linguistics_notes": "AmericanistAnnie Miner Peterson (AMP)International Phonetic Alphabet (IPA)Lolly\n\n‘cradle’,easy way to type it:    gwiihlLolly Metcalf’s South Slough MillukAmericanist PhoneticIPAFinally Lolly says:[gwi·ɫ],then[gwi·ɫ],then[gwi·ɫ]Finally Lolly says:[ɡwiˑɬ],then[ɡwiˑɬ],then[ɡwiˑɬ]\" jsaction=\"rcuQ6b:rcuQ6b;\">A Similar Sound Correspondence:  See what we say about the interview segment “Cup”.  There, we refer back to this interview segment, because in both interview segments one can see a sound correspondence between a velar consonant and a bilabial consonant.  Lolly has two versions of the Milluk word meaning ‘cup’, ‘dipper’, which are [ pásɪk̯ʼ ] followed by [ kwásɪk̯ʼ ].  Annie Miner Peterson’s version of the word is [ pásɪk̯ʼ ] .  However, Annie Miner Peterson’s Hanis word meaning ‘cup’, ‘dipper’ is | bɛ́ʰsɪk̯ʼ |.  So with the word meaning ‘cup’, ‘dipper’ we actually have a match up of [ p ] to [ kw ] within Coos Bay Milluk corresponding to [ p ] with Annie Miner Peterson’s Milluk, but matching [ b ] in her Hanis word of the same meaning.Instant Phonetic Englishization:  gweehl, for Lolly version of the word, beelh for Annie’s.\n\n‘cradle’,easy way to type it:    gwiihlLolly Metcalf’s South Slough MillukAmericanist PhoneticIPAFinally Lolly says:[gwi·ɫ],then[gwi·ɫ],then[gwi·ɫ]Finally Lolly says:[ɡwiˑɬ],then[ɡwiˑɬ],then[ɡwiˑɬ]\" jsaction=\"rcuQ6b:rcuQ6b;\">\n\nA Similar Sound Correspondence:  See what we say about the interview segment “Cup”.  There, we refer back to this interview segment, because in both interview segments one can see a sound correspondence between a velar consonant and a bilabial consonant.  Lolly has two versions of the Milluk word meaning ‘cup’, ‘dipper’, which are [ pásɪk̯ʼ ] followed by [ kwásɪk̯ʼ ].  Annie Miner Peterson’s version of the word is [ pásɪk̯ʼ ] .  However, Annie Miner Peterson’s Hanis word meaning ‘cup’, ‘dipper’ is | bɛ́ʰsɪk̯ʼ |.  So with the word meaning ‘cup’, ‘dipper’ we actually have a match up of [ p ] to [ kw ] within Coos Bay Milluk corresponding to [ p ] with Annie Miner Peterson’s Milluk, but matching [ b ] in her Hanis word of the same meaning.Instant Phonetic Englishization:  gweehl, for Lolly version of the word, beelh for Annie’s.\n\nA Similar Sound Correspondence:  See what we say about the interview segment “Cup”.  There, we refer back to this interview segment, because in both interview segments one can see a sound correspondence between a velar consonant and a bilabial consonant.  Lolly has two versions of the Milluk word meaning ‘cup’, ‘dipper’, which are [ pásɪk̯ʼ ] followed by [ kwásɪk̯ʼ ].  Annie Miner Peterson’s version of the word is [ pásɪk̯ʼ ] .  However, Annie Miner Peterson’s Hanis word meaning ‘cup’, ‘dipper’ is | bɛ́ʰsɪk̯ʼ |.  So with the word meaning ‘cup’, ‘dipper’ we actually have a match up of [ p ] to [ kw ] within Coos Bay Milluk corresponding to [ p ] with Annie Miner Peterson’s Milluk, but matching [ b ] in her Hanis word of the same meaning.\n\nInstant Phonetic Englishization:  gweehl, for Lolly version of the word, beelh for Annie’s.\n\nfor AMP:biihlAnnie Miner Peterson’s MillukExactly Jacobs’ transcriptionAmericanist Phonetic & IPAbi·ɫ[bi·ɫ]& [biˑɬ]\" jsaction=\"rcuQ6b:rcuQ6b;\">\n\nConfusion about [ kwi·ɫ ]: There is some confusion at the beginning of this interview segment about a pronunciation of the word that we hear as [ kwi·ɫ ].  Swadesh asks for that pronunciation which we assume he must have gotten originally from Lolly, in the part of the interview before the tape recorder was turned on.  Lolly repeats Swadesh’s pronunciation, but after that she says the word as [ gwi·ɫ ], also saying “baby” (cutting herself off without really finishing the word), cradle, ain’t it?”, then she pronounces the word as [ gwi·ɫ ] twice more.Something Similar with “Gun”: We also mention in the interview segment \"Cup\" the Milluk word meaning ‘gun’, to be found in the interview segment “Gun”, a word that means ‘large bow for big game’ in the Milluk texts.  One of Lolly Metcalf’s versions of that word is a pronunciation that we have transcribed as [ kubí·l ], but Lolly also has another version of the same word which is [ gugwí·l ] which closely matches Annie Miner Peterson’s word [ g̣ug̣wí·l ] ‘large bow for big game’.  In the case of that word the Hanis word is completely different.  In fact in Jacobs’ slip-file dictionary, there are two completely different Hanis words.\n\nConfusion about [ kwi·ɫ ]: There is some confusion at the beginning of this interview segment about a pronunciation of the word that we hear as [ kwi·ɫ ].  Swadesh asks for that pronunciation which we assume he must have gotten originally from Lolly, in the part of the interview before the tape recorder was turned on.  Lolly repeats Swadesh’s pronunciation, but after that she says the word as [ gwi·ɫ ], also saying “baby” (cutting herself off without really finishing the word), cradle, ain’t it?”, then she pronounces the word as [ gwi·ɫ ] twice more.\n\nSomething Similar with “Gun”: We also mention in the interview segment \"Cup\" the Milluk word meaning ‘gun’, to be found in the interview segment “Gun”, a word that means ‘large bow for big game’ in the Milluk texts.  One of Lolly Metcalf’s versions of that word is a pronunciation that we have transcribed as [ kubí·l ], but Lolly also has another version of the same word which is [ gugwí·l ] which closely matches Annie Miner Peterson’s word [ g̣ug̣wí·l ] ‘large bow for big game’.  In the case of that word the Hanis word is completely different.  In fact in Jacobs’ slip-file dictionary, there are two completely different Hanis words.",
