    "linguistics_notes": "AmericanistAnnie Miner Peterson (AMP)International Phonetic Alphabet (IPA)Lolly\n\nDie‘die’,easy way to write it:   k’ayuufor AMP:q’ayauLolly Metcalf’s South Slough MillukAnnie Miner Peterson’s MillukAmericanist PhoneticIPAExactly Jacobs’ transcriptionAmericanist  Phonetic & IPA[kʼáyu],then[kʼáyu][ˈkʼɑyu],then[ˈkʼɑyu]qʼáyau[qʼáyau]&[ˈqʼɑyɑu]Instant Phonetic\n  Englishization:   K!AH_yoo.Annie Miner Peterson’s q! is\n  farther back in the throat and she ends the word with yow, rhymes with ‘cow’.\" jsaction=\"rcuQ6b:rcuQ6b;\">This is not the only Milluk word where Mrs. Peterson has [ au ] at the end of a word where Mrs. Metcalf has [ u ].  See the Milluk word that is a translation of ‘marrow’.\n\n‘die’,easy way to write it:   k’ayuufor AMP:q’ayauLolly Metcalf’s South Slough MillukAnnie Miner Peterson’s MillukAmericanist PhoneticIPAExactly Jacobs’ transcriptionAmericanist  Phonetic & IPA[kʼáyu],then[kʼáyu][ˈkʼɑyu],then[ˈkʼɑyu]qʼáyau[qʼáyau]&[ˈqʼɑyɑu]Instant Phonetic\n  Englishization:   K!AH_yoo.Annie Miner Peterson’s q! is\n  farther back in the throat and she ends the word with yow, rhymes with ‘cow’.\" jsaction=\"rcuQ6b:rcuQ6b;\">\n\nAnnie Miner Peterson’s q! is\n  farther back in the throat and she ends the word with yow, rhymes with ‘cow’.\n\nThis is not the only Milluk word where Mrs. Peterson has [ au ] at the end of a word where Mrs. Metcalf has [ u ].  See the Milluk word that is a translation of ‘marrow’.",
