    "linguistics_notes": "AmericanistAnnie Miner Peterson (AMP)International Phonetic Alphabet (IPA)Lolly\n\nHow‘how’,easy way to type it:    da_X_jiiLolly Metcalf’s South Slough MillukAmericanist PhoneticIPA[dax̣dži],then[dʌx̣dži],then[dax̣dži][dax̣dʒi],then[dʌx̣dʒi],then[dax̣dʒi]\" jsaction=\"rcuQ6b:rcuQ6b;\">Mrs. Peterson said a variety of things in the Milluk texts which translate as ‘how’, but we have found no expression in the Milluk texts which translates as ‘how’ and actually matches what we hear Lolly say.  Putting together words that we see in the Milluk texts, this would seem to be an expression / da x̣ dži /, literally ‘there’ plus ‘from’ plus ‘what’, which we can transcribe here phonetically as [ da_x̣_dži ].  In this phonetic representation of it, we put in linking lines to show that the expression is pronounced all together as a phonetic phrase, as if it were one word, which is what we hear from Lolly.Instant Phonetic Englishization:  dah_hh_jee.for AMP:da_X_jiiAnnie Miner Peterson’s MillukExactly Jacobs’ transcriptionAmericanist Phonetic & IPAda  ‘there’x̣    ‘from’dji  ‘what’[da‿x̣‿dži]&[dɑ‿χ‿dʒi]\" jsaction=\"rcuQ6b:rcuQ6b;\">\n\n‘how’,easy way to type it:    da_X_jiiLolly Metcalf’s South Slough MillukAmericanist PhoneticIPA[dax̣dži],then[dʌx̣dži],then[dax̣dži][dax̣dʒi],then[dʌx̣dʒi],then[dax̣dʒi]\" jsaction=\"rcuQ6b:rcuQ6b;\">Mrs. Peterson said a variety of things in the Milluk texts which translate as ‘how’, but we have found no expression in the Milluk texts which translates as ‘how’ and actually matches what we hear Lolly say.  Putting together words that we see in the Milluk texts, this would seem to be an expression / da x̣ dži /, literally ‘there’ plus ‘from’ plus ‘what’, which we can transcribe here phonetically as [ da_x̣_dži ].  In this phonetic representation of it, we put in linking lines to show that the expression is pronounced all together as a phonetic phrase, as if it were one word, which is what we hear from Lolly.Instant Phonetic Englishization:  dah_hh_jee.\n\n‘how’,easy way to type it:    da_X_jiiLolly Metcalf’s South Slough MillukAmericanist PhoneticIPA[dax̣dži],then[dʌx̣dži],then[dax̣dži][dax̣dʒi],then[dʌx̣dʒi],then[dax̣dʒi]\" jsaction=\"rcuQ6b:rcuQ6b;\">\n\nMrs. Peterson said a variety of things in the Milluk texts which translate as ‘how’, but we have found no expression in the Milluk texts which translates as ‘how’ and actually matches what we hear Lolly say.  Putting together words that we see in the Milluk texts, this would seem to be an expression / da x̣ dži /, literally ‘there’ plus ‘from’ plus ‘what’, which we can transcribe here phonetically as [ da_x̣_dži ].  In this phonetic representation of it, we put in linking lines to show that the expression is pronounced all together as a phonetic phrase, as if it were one word, which is what we hear from Lolly.\n\nfor AMP:da_X_jiiAnnie Miner Peterson’s MillukExactly Jacobs’ transcriptionAmericanist Phonetic & IPAda  ‘there’x̣    ‘from’dji  ‘what’[da‿x̣‿dži]&[dɑ‿χ‿dʒi]\" jsaction=\"rcuQ6b:rcuQ6b;\">",
