    "linguistics_notes": "AmericanistAnnie Miner Peterson (AMP)International Phonetic Alphabet (IPA)Lolly\n\nNeck 2‘neck’, easy way to write it:    \n  maakʼfor AMP:  maaqʼLolly Metcalf’s South Slough MillukAnnie Miner Peterson’s MillukAm. PhoneticIPAExact JacobsAm. Phon. & IPA[ma·kʼ],then[ma·kʼ],then[ma·qʼ],then[ma·kʼ][mɑˑkʼ],then[mɑˑkʼ],then[mɑˑqʼ],then[mɑˑkʼ]ma·qʼ (Except that Jacobs’ apostrophe goes right on top of the\n  q, instead of after it the way that we have to type it.)[ma·qʼ ]&[mɑˑqʼ]Instant Phonetic Englishization:\n  .  mahk!, for Lolly regular version of\n  the word, but mahq!, for Annie’s version of the word and for Lolly’s\n  exaggerated version of the word, due to her exasperation.\" jsaction=\"rcuQ6b:rcuQ6b;\">We hear Laura Metcalf say [ ma·kʼ ], [ ma·kʼ ], [ ma·qʼ ], and [ ma·kʼ ].  Her first, second, and fourth pronunciations have such light pronunciations of the ejective k [ kʼ ] to the point where one could not tell that they were supposed to be ejectives, but we write them as if they were.  After Swadesh says “loud”, what she says as her third pronunciation of the word is in evident exasperation for being asked so many times in the interview by then, to say things louder.  Her third pronunciation of the word is a really exaggerated pronunciation of [ ma·qʼ ], with the final consonant definitely far back in the throat (i.e. uvular), and more than obviously being an ejective.  For this third token of the word, she goes beyond her own South Slough Milluk and beyond a normal pronunciation of [ ma·qʼ ].\n\n‘neck’, easy way to write it:    \n  maakʼfor AMP:  maaqʼLolly Metcalf’s South Slough MillukAnnie Miner Peterson’s MillukAm. PhoneticIPAExact JacobsAm. Phon. & IPA[ma·kʼ],then[ma·kʼ],then[ma·qʼ],then[ma·kʼ][mɑˑkʼ],then[mɑˑkʼ],then[mɑˑqʼ],then[mɑˑkʼ]ma·qʼ (Except that Jacobs’ apostrophe goes right on top of the\n  q, instead of after it the way that we have to type it.)[ma·qʼ ]&[mɑˑqʼ]Instant Phonetic Englishization:\n  .  mahk!, for Lolly regular version of\n  the word, but mahq!, for Annie’s version of the word and for Lolly’s\n  exaggerated version of the word, due to her exasperation.\" jsaction=\"rcuQ6b:rcuQ6b;\">\n\nma·qʼ (Except that Jacobs’ apostrophe goes right on top of the\n  q, instead of after it the way that we have to type it.)\n\nInstant Phonetic Englishization:\n  .  mahk!, for Lolly regular version of\n  the word, but mahq!, for Annie’s version of the word and for Lolly’s\n  exaggerated version of the word, due to her exasperation.\n\nWe hear Laura Metcalf say [ ma·kʼ ], [ ma·kʼ ], [ ma·qʼ ], and [ ma·kʼ ].  Her first, second, and fourth pronunciations have such light pronunciations of the ejective k [ kʼ ] to the point where one could not tell that they were supposed to be ejectives, but we write them as if they were.  After Swadesh says “loud”, what she says as her third pronunciation of the word is in evident exasperation for being asked so many times in the interview by then, to say things louder.  Her third pronunciation of the word is a really exaggerated pronunciation of [ ma·qʼ ], with the final consonant definitely far back in the throat (i.e. uvular), and more than obviously being an ejective.  For this third token of the word, she goes beyond her own South Slough Milluk and beyond a normal pronunciation of [ ma·qʼ ].",
