    "linguistics_notes": "AmericanistAnnie Miner Peterson (AMP)International Phonetic Alphabet (IPA)Lolly\n\nTear, He Tore It‘tear’, ‘tore’,easy way to type it:    shauut, shaughLolly Metcalf’s Coos Bay MillukAmericanist PhoneticIPA[šaut],then[šau·t],then[šauɣ],then[šauɣ][ʃɑut],then[ʃɑuˑt],then[ʃɑuɣ],then[ʃɑuɣ]\" jsaction=\"rcuQ6b:rcuQ6b;\">There is a Hanis verb transcribed by Frachtenberg (1913, page 202) as [ cîɣ­ ], with a gloss of ‘to tear (clothes)’.  In modern phonetic symbols, this Hanis word would be: [ šɪɣ ].  As a prompt twice, Swadesh seems to be saying: [ šɛɣ ], either from having seen the word in Frachenberg’s volume of Coos texts or having gotten it from Lolly Metcalf in the earlier part of the interview before the tape recorder had been turned on.Instant Phonetic Englishization:  The first time that Lolly says this word, it sounds just like the English word ‘shout’.  We wonder whether the fact that she had spoken that English word in the previous interview segment “Holler or Shout” could have had any effect on how she said this word meaning the first time that she says it in this interview segment.Mrs. Peterson seems not to have said this Milluk word at any time in her work with Melville Jacobs.\n\n‘tear’, ‘tore’,easy way to type it:    shauut, shaughLolly Metcalf’s Coos Bay MillukAmericanist PhoneticIPA[šaut],then[šau·t],then[šauɣ],then[šauɣ][ʃɑut],then[ʃɑuˑt],then[ʃɑuɣ],then[ʃɑuɣ]\" jsaction=\"rcuQ6b:rcuQ6b;\">There is a Hanis verb transcribed by Frachtenberg (1913, page 202) as [ cîɣ­ ], with a gloss of ‘to tear (clothes)’.  In modern phonetic symbols, this Hanis word would be: [ šɪɣ ].  As a prompt twice, Swadesh seems to be saying: [ šɛɣ ], either from having seen the word in Frachenberg’s volume of Coos texts or having gotten it from Lolly Metcalf in the earlier part of the interview before the tape recorder had been turned on.Instant Phonetic Englishization:  The first time that Lolly says this word, it sounds just like the English word ‘shout’.  We wonder whether the fact that she had spoken that English word in the previous interview segment “Holler or Shout” could have had any effect on how she said this word meaning the first time that she says it in this interview segment.Mrs. Peterson seems not to have said this Milluk word at any time in her work with Melville Jacobs.\n\n‘tear’, ‘tore’,easy way to type it:    shauut, shaughLolly Metcalf’s Coos Bay MillukAmericanist PhoneticIPA[šaut],then[šau·t],then[šauɣ],then[šauɣ][ʃɑut],then[ʃɑuˑt],then[ʃɑuɣ],then[ʃɑuɣ]\" jsaction=\"rcuQ6b:rcuQ6b;\">\n\nThere is a Hanis verb transcribed by Frachtenberg (1913, page 202) as [ cîɣ­ ], with a gloss of ‘to tear (clothes)’.  In modern phonetic symbols, this Hanis word would be: [ šɪɣ ].  As a prompt twice, Swadesh seems to be saying: [ šɛɣ ], either from having seen the word in Frachenberg’s volume of Coos texts or having gotten it from Lolly Metcalf in the earlier part of the interview before the tape recorder had been turned on.\n\nInstant Phonetic Englishization:  The first time that Lolly says this word, it sounds just like the English word ‘shout’.  We wonder whether the fact that she had spoken that English word in the previous interview segment “Holler or Shout” could have had any effect on how she said this word meaning the first time that she says it in this interview segment.\n\nMrs. Peterson seems not to have said this Milluk word at any time in her work with Melville Jacobs.",
